description:
The live recording of the new Hillsong United album- 'United We Stand' was a history making night. Thousands gathered on the last night of Encounterfest, a three-day encounter with God, to put to record what God is doing in the hearts of young people. The presence of God was all-consuming as the United Worship team led in 13 new songs, continually pursuing a fresh revelation of the salvation of God. This recording is unlike any previous Hillsong United album, and you don't want to miss out! You can order (download) your copy today!

This is a MPEG copy but if you click on my name there's also this same concert in DDR ISO.

God Bless. Seed.




